import {BrowserRouter as Router, Route, Routes} from 'react-router-dom'
import Voting from '../src/pages/Voting'
import SignIn from './pages/SignIn';
function App() {
  return (
  <Router>
    <Routes>
      <Route path='/voting' element={ <Voting/> }/>
      <Route path='/' element={ <SignIn/> }/>
    </Routes>
  </Router>
  );
}

export default App;
